    // MARK: - 4, findMedianSortedArrays
    func test4_1() throws {
        // Given
        let sut = Solution4()
        
        let nums1 = [1,3]
        let nums2 = [2]
        
        // When
        let result = sut.findMedianSortedArrays(nums1, nums2)
        
        // Then
        XCTAssertEqual(result, 2.0, accuracy: 0.0001)
    }
    
    func test4_2() throws {
        // Given
        let sut = Solution4()
        
        let nums1 = [1,2]
        let nums2 = [3,4]
        
        // When
        let result = sut.findMedianSortedArrays(nums1, nums2)
        
        // Then
        XCTAssertEqual(result, 2.5, accuracy: 0.0001)
    }
    
    // MARK: - 5, longestPalindrome
    func test5_1() throws {
        // Given
        let sut = Solution5()
        
        let s = "babad"
        
        // When
        let result = sut.longestPalindrome(s)
        
        // Then
        XCTAssert(result == "bab" || result == "aba")
    }
    
    func test5_2() throws {
        // Given
        let sut = Solution5()
        
        let s = "cbbd"
        
        // When
        let result = sut.longestPalindrome(s)
        
        // Then
        XCTAssert(result == "bb")
    }
    
    func test5_3() throws {
        // Given
        let sut = Solution5()
        
        let s = "ac"
        
        // When
        let result = sut.longestPalindrome(s)
        
        // Then
        XCTAssert(result == "a" || result == "c")
    }
    
    // MARK: - 10, is match
    func test10_1() throws {
        // Given
        let sut = Solution10()
        
        let s = "aa"
        let p = "a"
        
        // When
        let result = sut.isMatch(s, p)
        
        // Then
        XCTAssertFalse(result)
    }
    
